SELECT MAX("probehnuto"."kc_proklikano") as agg_0, SUM("probehnuto"."kc_proklikano" + "probehnuto"."client_id") as agg_1 FROM "probehnuto" LEFT OUTER JOIN "client" ON "probehnuto"."client_id" = "client"."client_id" LEFT OUTER JOIN "probehnuto_mimo_penezenku" ON "client"."client_id" = "probehnuto_mimo_penezenku"."client_id" LEFT OUTER JOIN "dobito" ON "client"."client_id" = "dobito"."client_id"  WHERE "probehnuto"."client_id" BETWEEN 45388.29111617898 AND 59299.66721868047 AND "client"."obor" NOT LIKE '%Ozz%y%'